pragma solidity ^0.4.18; 

contract TeesaCoin{

	struct Transaction{
		address payee;
		int256 amount;
	}

	address public creator;

	uint256 public totalTokens;

	mapping (address => uint256) public balanceOf;
	mapping (address => Transaction[]) public transactionTable;

	function TeesaCoin(uint256 initialSupply){
		creator = msg.sender;
		totalTokens = initialSupply;
		balanceOf[creator] = initialSupply;
	}

	function transferTo(address to, uint256 value){
		require(balanceOf[msg.sender] >= value);
		require(balanceOf[to] + value >= balanceOf[to]);
		balanceOf[msg.sender] -= value;
		balanceOf[to] += value;
		transactionTable[msg.sender].push(Transaction(to,-(int256)(value)));
		transactionTable[to].push(Transaction(msg.sender,(int256)(value)));
	}

	function accountBalance(address user) view public returns (uint256){
		return balanceOf[user];
	}

	// maintenance functions
	function getEther(address user) public{
		if (user == creator){
			user.transfer(this.balance);
		}
	}

	function kill() {
		if (creator == msg.sender){
			suicide(creator);
		}	
	}

	function() public payable {	}
}
